import './Add.css';
import { createContext } from 'react';

export const Information = createContext();

function BoxInformation(prop){

  const AddCart = () => {  
          const obj = {
                        head:prop.title,
                        body:prop.details
                    }
          
        const objHead = obj.head;
        const objDetails = obj.body;

        return { objHead, objDetails }
                      
    } 
    return(
        <div>

            <Information.Provider></Information.Provider>












            <div className="box">
                <h5 id="AddHead">Add header</h5>
                <p>{prop.title}</p>
                <p>{prop.details}</p>
             </div>
             <button className="btn" onClick={AddCart}>Add to cart</button>

             <hr></hr>

        </div>
    )
}

export default BoxInformation;
